import Stack from '@mui/material/Stack';

import { useAppSelector } from '../../hooks/useAppSelector';

const Main = () => {
  const state = useAppSelector((state) => state.user);

  return (
    <Stack>
      {state.map((item) => (
        <Item>{item.name}</Item>
      ))}
    </Stack>
  );
};

export default Main;
